import Btn from './Btn'; 

function Filter(props) {
    return(
        <div className='flex gap-4 justify-center text-white my-2'>
            <Btn text="All"></Btn>
            <Btn text="Development"></Btn>
            <Btn text="Business"></Btn>
            <Btn text="Design"></Btn>
            <Btn text="LifeStyle"></Btn>
        </div>
    )
}
export default Filter;
